class Solution:
    def maxOperations(self, s: str) -> int:
        res = 0
        t = 0
        p = 0
        for c in s:
            if c == '1':
                if p > 0:
                    res += t
                t += 1
                p = 0
            else:
                p = 1
            #print (c, t, p)
        if p > 0:
            res += t
        return res
